import React from 'react';
import { SouthKorea } from '@svg-maps/south-korea';
import { SVGMap } from 'react-svg-pan-zoom';

const MapSvg = () => (
    <div style={{ width: '500px', height: '500px' }}>
        <SVGMap map={SouthKorea} />
    </div>
);

export default MapSvg;
